import React from 'react'
//import './react-resizable.css'
//import './react-grid-layout.css'
import 'react-grid-layout/css/styles.css' 
import 'react-resizable/css/styles.css' 
import GridLayout from 'react-grid-layout';
import MainOperationWindow from './OperationWindow/MainComponent'
import { Responsive as ResponsiveGridLayout } from 'react-grid-layout';

class MainWindow extends React.Component {
  render() {
    // layout is an array of objects, see the demo for more complete usage
/*const layout = [
    {i: 'a', x: 0, y: 0, w: 1, h: 2},
    {i: 'b', x: 1, y: 0, w: 3, h: 2},
    {i: 'c', x: 4, y: 0, w: 1, h: 2},
    {i: 'd', x: 3, y: 0, w: 1, h: 2},
    {i: 'e', x: 2, y: 0, w: 1, h: 2},
    {i: 'f', x: 0, y: 0, w: 1, h: 2},
  ];
  return (
    <ResponsiveGridLayout className="layout" layout={layout} cols={12} rowHeight={100} width={3000}>
      <div   style={{ backgroundColor: 'blue'}}  key="a">a</div>
      <div key="b">
        <MainOperationWindow />
      </div>
      <div   style={{ backgroundColor: 'blue'}} key="c"> c</div>
      <div   style={{ backgroundColor: 'blue'}} key="d">d</div>
      <div   style={{ backgroundColor: 'blue'}} key="e">e</div>
      <div   style={{ backgroundColor: 'blue'}} key="f">f</div>
    </ResponsiveGridLayout>
  )*/

    // {lg: layout1, md: layout2, ...}
    const layouts = [
      {i: 'a', x: 0, y: 0, w: 55, h: 10},
      {i: 'b', x: 1, y: 0, w: 3, h: 2},
      {i: 'c', x: 4, y: 0, w: 1, h: 2},
      {i: 'd', x: 3, y: 0, w: 1, h: 2},
      {i: 'e', x: 2, y: 0, w: 1, h: 2},
      {i: 'f', x: 0, y: 0, w: 1, h: 2},
    ];
    return (
      <ResponsiveGridLayout className="layout" layouts={layouts}
        breakpoints={{lg: 1200, md: 996, sm: 768, xs: 480, xxs: 0}}
        cols={{lg: 12, md: 10, sm: 6, xs: 4, xxs: 2}}>
        <div key="a"  style={{ backgroundColor: 'blue'}}>1
        <MainOperationWindow />
        </div>
        <div key="b">2</div>
        <div key="c">3</div>
      </ResponsiveGridLayout>
    )
  }


}
export default MainWindow;
